	/**
	 * 从JSON数据中获取公交信息，并插入数据库
	 * @param jBusData
	 * @throws JSONException 
	 */
	private void insertBusDataFromJson(String jBusData) throws JSONException {
		
		// 组装JSON数据
//		JSONObject jsonObj = new JSONObject(jBusData);
		
		// 取得公交数据
//		JSONObject busDataJ = jsonObj.getJSONObject("bus_info");
		JSONObject busDataJ = new JSONObject(jBusData);
		
		// 站点数据
		JSONArray busStationJArray = busDataJ.getJSONArray("bus_station");
		insertBusStationDataFromJsonArray(busStationJArray);
		
		// 线路数据
		JSONArray busRouteJArray = busDataJ.getJSONArray("bus_route");
		insertBusRouteDataFromJsonArray(busRouteJArray);
		
		// 站点与线路的关联数据
		JSONArray busStationSignJArray = busDataJ.getJSONArray("bus_stop_sign");
		insertBusStationSignDataFromJsonArray(busStationSignJArray);
	}
	
	/**
	 * 从JSONArray数据中获取公交站点信息，并插入数据库
	 * @param jBusData
	 * @throws JSONException 
	 */
	private void insertBusStationDataFromJsonArray(JSONArray jArray) throws JSONException  {
		// 非空
		if(jArray == null || jArray.length() <= 0) {
			return;
		}
		
		// 解析数据，拼装对象，插入数据库
		for (int i = 0; i < jArray.length(); i++) {
			
			// 设置JSONObject
			JSONObject jDate = jArray.getJSONObject(i);
			
			if(jDate != null) {
				
				// 创建数据对象
				Station station = new Station(
						jDate.getString("busStopId"),
						jDate.getString("busStopName"),
						jDate.getInt("longitude"),
						jDate.getInt("latitude"),
						jDate.getString("direction"));
				
				// 插入数据库
				insertBusStation(station);
			}
		}
	}
	
	/**
	 * 从JSONArray数据中获取公交线路信息，并插入数据库
	 * @param jBusData
	 * @throws JSONException 
	 */
	private void insertBusRouteDataFromJsonArray(JSONArray jArray) throws JSONException  {
		// 非空
		if(jArray == null || jArray.length() <= 0) {
			return;
		}
		
		// 解析数据，拼装对象，插入数据库
		for (int i = 0; i < jArray.length(); i++) {
			
			// 设置JSONObject
			JSONObject jDate = jArray.getJSONObject(i);
			
			if(jDate != null) {
				
				// 创建数据对象
				Bus bus = new Bus(
						jDate.getString("routeId"), 
						jDate.getString("routeName"), 
						jDate.getString("routeKey"), 
						jDate.getString("direction"));
				
				// 插入数据库
				insertBusRoute(bus);
			}
		}
	}
	
	/**
	 * 从JSONArray数据中获取公交线路与站点的对应关系信息，并插入数据库
	 * @param jBusData
	 * @throws JSONException 
	 */
	private void insertBusStationSignDataFromJsonArray(JSONArray jArray) throws JSONException  {
		// 非空
		if(jArray == null || jArray.length() <= 0) {
			return;
		}
		
		// 解析数据，拼装对象，插入数据库
		for (int i = 0; i < jArray.length(); i++) {
			
			// 设置JSONObject
			JSONObject jDate = jArray.getJSONObject(i);
			
			if(jDate != null) {
				
				List<String> routeStopNos = new ArrayList<String>();
				routeStopNos.add(jDate.getString("routeStopNo"));
				
				List<String> busStopIds = new ArrayList<String>();
				busStopIds.add(jDate.getString("busStopId"));
				
				// 创建数据对象
				Bus bus = new Bus(
						jDate.getString("routeId"), 
						routeStopNos, 
						busStopIds);	
				
				// 插入数据库
				insertBusStationSign(bus);
			}
		}
	}
	
	/**
	 * 插入公交数据
	 * @param bus
	 * @return
	 */
	public long insertBusRoute(Bus bus) {
		
		long insertStatus = -1L;
		
		// 组装数据
		ContentValues cv = new ContentValues();
		
		cv.put("routeId", bus.getRouteId());
		cv.put("routeName", bus.getRouteName());
		cv.put("routeKey", bus.getRouteKey());
		cv.put("direction", bus.getDirection());
		
		// 收藏
		if(bus.isSave()) {
			cv.put("isSave", IS_SAVE_FLAG);
		} else {
			cv.put("isSave", IS_NOT_SAVE_FLAG);
		}
		
		// 插入数据
		insertStatus = insertRecode(TABLE_BUS_ROUTE, cv);
		
		close();
		
		return insertStatus;
	} 
	
	/**
	 * 插入公交数据
	 * @param bus
	 * @return
	 */
	public long insertBusStation(Station station) {
		
		long insertStatus = -1L;
		
		// 组装数据
		ContentValues cv = new ContentValues();
		
		cv.put("busStopId", station.getStationId());
		cv.put("busStopName", station.getName());
		cv.put("longitude", station.getLongitude());
		cv.put("latitude", station.getLatitude());
		cv.put("direction", station.getDirection());
		
		// 收藏
		if(station.isSave()) {
			cv.put("isSave", IS_SAVE_FLAG);
		} else {
			cv.put("isSave", IS_NOT_SAVE_FLAG);
		}
		
		// 插入数据
		insertStatus = insertRecode(TABLE_BUS_STATION, cv);
		
		close();
		
		return insertStatus;
	} 
	
	/**
	 * 插入公交与站台的关联表
	 * @param bus
	 * @return
	 */
	public long insertBusStationSign(Bus bus) {
		
		long insertStatus = -1L;
		
		// 循环插入当前公交对应的站台信息
		List<String> routeStopNos = bus.getRouteStopNos();
		
		for (int i = 0; i < routeStopNos.size(); i++) {
			
			// 组装数据
			ContentValues cv = new ContentValues();
			
			cv.put("routeId", bus.getRouteId());
			cv.put("routeStopNo", routeStopNos.get(i));
			cv.put("busStopId", bus.getBusStopIds().get(i));
			
			// 插入数据
			insertStatus = insertRecode(TABLE_BUS_STOP_SIGN, cv);
			
			close();
		}
		return insertStatus;
	}
	
	/**
	 * 取得公交对应的站点ID
	 * @param routeId
	 * @return
	 */
	public List<String> getBusStopIds(String routeId) {
		
		List<String> stopIds = new ArrayList<String>();
		
		// 取得查找Cursor
		Cursor cursor = selectRecode(TABLE_BUS_STOP_SIGN, null, "routeId" + "=?",
				new String[] { routeId }, null, null, "routeStopNo");
		
		// 遍历所有数据库查询的对象
		for (cursor.moveToFirst(); !cursor.isAfterLast(); cursor.moveToNext()) {
			
			stopIds.add(cursor.getString(cursor.getColumnIndex("busStopId")));
			Log.d("debug", "busStopId > " + cursor.getString(cursor.getColumnIndex("busStopId")));
		}
		
		// 关闭数据库连接
		close();
		
		return stopIds;
	}
	
